ode()?.parentNode; // the one above svg\n\n        if (!chartElement) {\n            throw new Error(\"Chart parent node is not defined\");\n        }\n\n        const dataPointsLeft = Math.min(...valArr.map(d => d.position.x));\n        const dataPointsTop = Math.min(...valArr.map(d => d.position.y));\n        const left = chartElement.offsetLeft + this.chart.getGrid().config().dimension.margin.left\n            + dataPointsLeft + this.chart.getGrid().config().dimension.width() / 2;\n        const top = chartElement.offsetTop + dataPointsTop + this.chart.getGrid().config().dimension.height() / 2;\n        return {\n            top: top,\n            left: left,\n            height: 0,\n            width: 0,\n        };\n    }\n}\n\n    \n\n\n\n\n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"classes/RadialTooltipsPlugin.html":{"url":"classes/RadialTooltipsPlugin.html","title":"class - RadialTooltipsPlugin","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n  Classes\n  RadialTooltipsPlugin\n\n\n\n        \n            API\n        \n        \n            Source\n        \n\n\n\n    \n        \n            File\n        \n        \n            src/core/plugins/tooltips/radial-tooltips-plugin.ts\n        \n\n            \n                Description\n            \n            \n                This radial tooltips plugin handles special tooltip positioning requirements for donut / pie charts.\n\n            \n\n            \n                Extends\n            \n            \n                        ChartTooltipsPlugin\n            \n\n\n\n            \n    Index\n    \n        \n                \n                    \n                        Properties\n                    \n                \n                \n                    \n                        \n                            \n                                    Public\n                         